// [YSIS_student_data display='program_advisor_name']
//  Display have 3 parameters: 
//  display = 'program_advisor_name'   : get current user's advisor name
//  display = 'program_advisor_contact'   : get current user's advisor contact info (email, phone)
//  display = 'program_info'   : get current user's program info
//  display = 'program_advisor_photo'   : get current user's advisor photo
function YSIS_student_data_function($attr){
	
	$user_meta = json_decode(get_user_meta(get_current_user_id(), "ysis_data", true));
	//var_dump($user_meta->ProgramBase);
	//var_dump($user_meta);
	//var_dump($user_meta->StateProv);
	
		// if current user is not in any program, then return "Not Available"
		if(is_null($user_meta->ProgramBase)){
			$message =  '';
			return $message;
		}

		if($attr['display'] == "program_advisor_name"){
			
			// get program advisor Full name
			return "<strong>Program Advisor:  </strong>".$user_meta->ProgramAdvisor_FirstName ." ".$user_meta->ProgramAdvisor_LastName;
		}

		if($attr['display'] == "program_advisor_contact"){
			
			// get program advisor contact info
			return "<strong>Contact Information:</strong>Email: ".$user_meta->ProgramAdvisor_Email .", EXT: ".$user_meta->ProgramAdvisor_PhoneExtension;
		}
		
		if($attr['display'] == "program_info"){
			//get current user's program info
			return "<strong>Your Program: </strong>".$user_meta->ProgramCore;
		}
		
		if($attr['display'] == "program_advisor_photo"){
			// get current user's advisor photo
			return "<img width='100%' src='".$user_meta->PictureURLPA."' />";
		}
	
	
		
	
}
add_shortcode( 'YSIS_student_data', 'YSIS_student_data_function' );


